import React, {useState} from 'react';
import { View, } from 'react-native';

function _tasks(){

    const [task,setTask] = useState([
        {
          key: 1,
          task: "comprar pao"
        },
        {
          key: 2,
          task: "react native"
        },
        {
          key: 3,
          task: "tarefinha"
        },
    
    ]);

    return(
        task.map((item)=>{
            item.task;
        })
    )

}

export default _tasks;
